import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { getUser, logout } from "../Actions/UserActions";
import { withStyles } from "@material-ui/core/styles";
import compose from "recompose/compose";
import { connect } from "react-redux";
import "./Navbar.css";
import DSLR from "../Container/DSLR";
import MenuBar from "./MenuBar";
const styles = {
  root: {
    flexGrow: 1
  },
  button: {
    color: "#d6d7da",
    fontSize: 18,
    alignItems: "center",
    height: 50,
    fontFamily: "'Montserrat', sans-serif",
    cursor: "pointer"
  },
  tit: {
    textDecoration: "none",
    cursor: "pointer"
  }
};

class NavbarPage extends Component {
  getUsername() {
    console.log(this.props.user);
  }
  render() {
    const { classes } = this.props;
    return (
      <nav id="menu" className="menu " className="appbar">
        <Link to="/" className={classes.tit}>
          {" "}
          <button className="but-title">
            {" "}
            <h3 className="title">Kroz objektiv</h3>
          </button>{" "}
        </Link>
        <div className="dropdown">
          <button className="dropbtn">Tipovi fotoaparata</button>
          <div className="dropdown-content">
            <a href="/dslr">DSLR</a>
            <a href="#">Mirrorless</a>
            <a href="#">Kompaktni</a>
            <a href="#">Analogni</a>
            <a href="#">Canon</a>
            <a href="#">Nikon</a>
            <a href="#">Canon</a>
            <a href="#">Sony</a>
            <a href="#">Pentax</a>
          </div>
        </div>
        <div className="dropdown">
          <button className="dropbtn">Tips'n'tricks</button>
          <div className="dropdown-content">
            <a href="#">Sve</a>
            <a href="#">Kamera trikovi</a>
            <a href="#">Video trikovi</a>
            <a href="#">Editiranje</a>
          </div>
        </div>
        <div className="dropdown">
          <button className="dropbtn">Oprema</button>
          <div className="dropdown-content">
            <a href="#">Sve</a>
            <a href="#">Objektivi</a>
            <a href="#">Bljeskalice</a>
            <a href="#">Filteri</a>
          </div>
        </div>
        <div className="dropdown">
          <button className="dropbtn"> {this.getUsername()}</button>
          <div className="dropdown-content">
            <a href="#">Sve</a>
            <a href="#">Objektivi</a>
            <a href="#">Bljeskalice</a>
            <a href="#">Filteri</a>
          </div>
        </div>
      </nav>
    );
  }
}
NavbarPage = connect(
  (state, ownProps) => ({
    posts: state.posts,
    user: state.user
  }),
  { savePost, getPosts, deletePost, getUser, logout }
)(NavbarPage);
NavbarPage.propTypes = {
  classes: PropTypes.object.isRequired
};
export default compose(withStyles(styles))(NavbarPage);
